package com.sanjeet.sessionmanager.dataBaseimport androidx.room.ColumnInfoimport androidx.room.Entityimport androidx.room.PrimaryKey@Entity(tableName = "session_records")data class SessionModel(    @PrimaryKey(autoGenerate = true) val id: Long = 0L,    @ColumnInfo(name = "start_time")    val startTime: String,    @ColumnInfo(name = "end_time")    var endTime: String? = null,    @ColumnInfo(name = "duration")    val duration: Long,    @ColumnInfo(name = "is_online")    var isOnline: Boolean = false)